import React from 'react';

export interface VerticalProps {
  children: any;
}

const Vertical: React.SFC<VerticalProps> = ({ children }) => {
  return (
    <ul className="list-group list-group-horizontal list-group-flush">
      {children}
    </ul>
  );
};

export default Vertical;
